def decrypt_password(password, encrypted_message):
    key32 = "{: <32}".format(password).encode("utf-8")
    obj = AES.new(key32, AES.MODE_CBC, 'This is an IV456')
    decrupted = obj.decrypt(encrypted_message)
    return decrupted.decode("utf-8")

